<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<title>Recibo de Constancia de Pago</title>
<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>
<style>
  body {
    font-family: Arial, sans-serif;
    font-size: 12px;
    margin: 0;
    padding: 0;
    background: #f0f0f0;
  }

  .contenedor {
    background: #fff;
    width: 555.3pt; /* tama√±o carta menos 1cm margen a cada lado */
    margin: 20px auto;
    padding: 20px;
    border: 1px solid #000;
    position: relative;
  }

  .logo {
    position: absolute;
    top: 20px;
    left: 20px;
    width: 120px;
    height: 100px;
    object-fit: contain;
  }

  .numero-recibo {
    position: absolute;
    top: 20px;
    right: 20px;
    font-weight: bold;
    color: #f00;
  }

  h2 {
    text-align: center;
    margin: 0 0 10px;
    font-size: 20px;
  }

  .info {
    display: flex;
    margin-bottom: 8px;
    align-items: center;
  }

  .info label {
    width: 120px;
    font-weight: bold;
    margin-right: 5px;
    text-align: right;
    white-space: nowrap;
  }

  .info input[type="text"],
  .info input[type="number"] {
    flex: 1;
    border: none;
    border-bottom: 1px solid #ccc;
    padding: 3px;
    background: #f9f9f9;
  }

  .info.fecha {
    justify-content: center;
    margin: 10px 0;
  }

  .info.fecha label {
    font-weight: bold;
    margin-right: 5px;
    width: auto;
    text-align: left;
  }

  .info input[type="date"] {
    border: none;
    border-bottom: 1px solid #ccc;
    padding: 3px;
    background: #f9f9f9;
    width: 120px;
  }

  .forma-pago {
    margin: 15px 0 0;
    text-align: center;
  }

  .forma-pago label {
    margin-right: 10px;
  }

  #numCheque {
    width: 80px;
    text-align: center;
    border: none;
    border-bottom: 1px solid #ccc;
    background: #f9f9f9;
  }

  .firma {
    margin-top: 30px;
    text-align: center;
  }

  .firma input {
    border: none;
    border-bottom: 1px dotted #999;
    background: #f0f0f0;
    width: 200px;
    text-align: center;
    padding: 3px;
  }

  .boton {
    display: block;
    margin: 20px auto;
    padding: 10px 20px;
    background: #007BFF;
    color: #fff;
    border: none;
    cursor: pointer;
  }

  @media print {
    .boton {
      display: none;
    }
  }
</style>
</head>

<button class="boton" onclick="guardarPDF()">Guardar como PDF</button>

<script>
  function numeroALetras(num) {
    if (isNaN(num) || num === '') return '';
    const unidades = ['cero', 'uno', 'dos', 'tres', 'cuatro', 'cinco', 'seis', 'siete', 'ocho', 'nueve'];
    const decenas = ['diez', 'once', 'doce', 'trece', 'catorce', 'quince', 'diecis√©is', 'diecisiete', 'dieciocho', 'diecinueve'];
    const decenas2 = ['', '', 'veinte', 'treinta', 'cuarenta', 'cincuenta', 'sesenta', 'setenta', 'ochenta', 'noventa'];
    const centenas = ['cien', 'ciento', 'doscientos', 'trescientos', 'cuatrocientos', 'quinientos', 'seiscientos', 'setecientos', 'ochocientos', 'novecientos'];

    function convertir(num) {
      if (num < 10) return unidades[num];
      if (num >= 10 && num < 20) return decenas[num - 10];
      if (num >= 20 && num < 100) {
        let d = Math.floor(num / 10);
        let u = num % 10;
        if (u === 0) return decenas2[d];
        return decenas2[d] + ' y ' + unidades[u];
      }
      if (num >= 100 && num < 1000) {
        let c = Math.floor(num / 100);
        let r = num % 100;
        if (num === 100) return centenas[0];
        return centenas[c] + (r > 0 ? ' ' + convertir(r) : '');
      }
      if (num >= 1000) {
        let miles = Math.floor(num / 1000);
        let resto = num % 1000;
        let milesTexto = (miles === 1) ? 'mil' : convertir(miles) + ' mil';
        return milesTexto + (resto > 0 ? ' ' + convertir(resto) : '');
      }
      return '';
    }

    let partes = num.toString().split('.');
    let entero = parseInt(partes[0], 10);
    let decimal = partes[1] ? partes[1].padEnd(2, '0') : '00';
    return convertir(entero) + ' con ' + decimal + '/100';
  }

  document.getElementById('cantidadNumeros').addEventListener('input', function() {
    const num = this.value;
    document.getElementById('cantidadLetras').value = numeroALetras(num);
  });

  async function guardarPDF() {
    const { jsPDF } = window.jspdf;
    const pdf = new jsPDF({ orientation: 'portrait', unit: 'pt', format: 'letter' });
    const canvas = await html2canvas(document.getElementById('recibo'), { scale: 2 });
    const imgData = canvas.toDataURL('image/png');
    pdf.addImage(imgData, 'PNG', 40, 40, 530, 700);
    pdf.save('Recibo.pdf');
  }

  document.getElementById('fecha').value = new Date().toISOString().substr(0, 10);
</script>
